function Adventures() {
return(

  <div>
  <h1 className="WelcomeTitle">Explore your Adventure</h1>
  <p>Check out what Nelson has to offer!</p>
  <Cards/>
</div>
)

}



// Must export the component so another can see it
export default Adventures;
